  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains information about
  the American White Pelican population for the Anaho Island National Wildlife Refuge
  in the Stillwater National Wildlife Refuge Complex from calendar years 1961 to 1970.
  Documents within in the collection include hand-written notes, offices memorandums,
  bird counts, typed reports and aerial photographs. Species covered in the research
  are American White Pelican, Double-crested Cormorant, Canada Goose, California Gull,
  Caspian Tern, Great Blue Heron, and miscellaneous other birds. Dates and quantities
  for bird counts are not limited to Anaho Island, but span to most of the western
  United States. Documents collected also include research proposals, chlorinated
  hydrocarbon residues found in bird tissue samples and reports summarizing bird statuses
  in Nevada and other western states.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
